      "codigoSeguridad":"09878"
    }]}]

  }]

  return (
    <div className="App">
      <Headers nuevoVideo={nuevoVideo} cambio={cambio} />
      {
        cambio===true?<><FondoImagen /> 
         <CarriucelContenedor /></>:<NuevoVideo />
      }


      <Footer />
    </div>
  );
}

export default App;
